const { getToken, isAuth } = require('../util');
const router = express.Router();

// memuat admin
router.get('/createAdmin', async (req, res) => {
    try {
        const user = new User({
            username : 'zdipo',
            email : 'adipo@admin.com',
            password : 'admin',
            isAdmin : true
        })
        const newUser = await user.save();
        res.send(newUser)
        
    } catch (error) {
        console.log(error.message)
